class MessageParser {
    constructor(actionProvider, state) {
      this.actionProvider = actionProvider; // 액션을 수행할 수 있는 provider
      this.state = state; // 현재 상태
    }
  
    parse(message) {
      console.log(message);
      if (message.includes("hello")) {
        this.actionProvider.greet(); // hello가 포함된 메시지라면 greet 액션 수행
      }
    }
  }
  
  export default MessageParser;
